import { DefaultTheme } from "styled-components";

export const defaultTheme: DefaultTheme = {
  lightBgTextColor: "#3A3A3A",
  colorBgTextColor: "#FFFFFF",
  colorBgSubTextColor: "#F7F7F7",
  colorBgDescriptColor: "#C0C5C4",
};
